import { FormBot } from './FormBot';

export const Card = () => {
    return (
        <div className="card-box ">
            <img src="https://res.cloudinary.com/dnjk2bwkp/image/upload/v1597238291/ricardo/ricardo_iggujk.svg" alt="Ricardo" class="ricardo-header-img" />
            <div className="card-text"><h1 className="ricardo-h1">Ricardo Pineda</h1><p className="ricardo-p ">Attefallsf√∂rmedlaren</p></div>
        </div>
    )
}
export default withStyles([styles, otherStyles])(FormBot);
